import SearchBar from "../SearchBar";
import { Link } from "react-router-dom";
import Logo from "../../assets/logo.png"
export default function Nav(props) {

    return (
        <div style={{
            width: '100%',
            backgroundColor: 'gray',
            display: 'flex',
            position:'relative',
            alignItems:'center',

        }}>
            <img src={Logo} alt='Rick_And_Morty' style={{width:250, marginLeft:'10%'}}/>
            <div ><SearchBar onSearch={props.onSearch}  /></div>
            <div style={{ display: 'flex', 
            position:'absolute', 
            right:'40%', 
           
            }}>
                <div
                style={{
                    margin:10
                }}><Link to={"/home"} style={{
                    color:'white',
                    textDecoration:'none',
                    
                    }}><div >Home</div></Link></div>
                <div style={{
                    margin:10
                }}><Link to={"/about"} style={{
                    color:'white',
                    textDecoration:'none',
                    
                    }}><div>About</div></Link></div>
            </div>
        </div>
    );

}
